- uid: RainWorldBestiary.Types.CreatureUnlockToken.OperationAgainstCurrentValue
  commentId: F:RainWorldBestiary.Types.CreatureUnlockToken.OperationAgainstCurrentValue
  id: OperationAgainstCurrentValue
  parent: RainWorldBestiary.Types.CreatureUnlockToken
