  name: OperationAgainstCurrentValue
  nameWithType: CreatureUnlockToken.OperationAgainstCurrentValue
  fullName: RainWorldBestiary.Types.CreatureUnlockToken.OperationAgainstCurrentValue
  type: Field
  assemblies:
  - RainWorldBestiary
  namespace: RainWorldBestiary.Types
  summary: The operation this unlock token will perform against the current unlock value of the token
  remarks: >-
    For example, if the previous two tokens where valid, that means the current unlock value is true, since by the logic of the two previous tokens, the module should be unlocked.
                Then if this unlock tokens operation is "or", that it will check if the current unlock value OR this value is true, then set the result as the new current unlock value
  example: []
  syntax:
    content: public OperationType OperationAgainstCurrentValue
    return:
      type: RainWorldBestiary.Types.OperationType
    content.vb: Public OperationAgainstCurrentValue As OperationType
